
--dt 18-05-2021 --> ZPD-14205
UPDATE ZnodeState SET StateName = dbo.Fn_CamelCase(ltrim(rtrim(replace(StateName,' ','')))) 
WHERE StateName like ' %' and  countrycode ='mx'

UPDATE ZnodeState SET StateName = dbo.Fn_CamelCase(ltrim(rtrim(StateName))) 

UPDATE ZnodeState SET StateName = replace(dbo.Fn_CamelCase(ltrim(rtrim(replace(StateName,'-',' - ')))),' - ','-') 
where StateName like '%-%'

UPDATE ZnodeState SET StateName = replace(dbo.Fn_CamelCase(ltrim(rtrim(replace(StateName,'(',' ( ')))),' ( ','(') 
where StateName like '%(%'

UPDATE ZnodeState SET StateName = replace(dbo.Fn_CamelCase(ltrim(rtrim(replace(StateName,'[',' [ ')))),' [ ','[') 
where StateName like '%[%'


UPDATE ZnodeState SET StateName = dbo.Fn_CamelCase(ltrim(rtrim(replace(StateName,substring(StateName,1,1),''))))
WHERE CountryCode = 'MX' and substring(StateName,1,1) not like '%[a-Z]%'


UPDATE ZnodeState SET StateName = replace(dbo.Fn_CamelCase(ltrim(rtrim(replace(StateName,'(','( ')))),'( ','(')
where StateName like '%(%'

--ZPD-12537

IF OBJECT_ID(N'tempdb..#tmpznodestate') IS NOT NULL
	DROP TABLE #tmpznodestate

SELECT ROW_NUMBER() OVER (
      PARTITION BY  CountryCode, StateName
      ORDER BY StateId ) rownum,* 
INTO #tmpznodestate 
FROM ZnodeState

ALTER TABLE #tmpznodestate ADD  new_stcode VARCHAR(510);

UPDATE t1
SET new_stcode = t.statecode
FROM #tmpznodestate t INNER JOIN #tmpznodestate t1 ON t.statename =t1.statename and t.countrycode= t1. countrycode
WHERE t1.rownum >1 and t.rownum=1

UPDATE zc
SET statecode = new_stcode
FROM znodecity zc
INNER JOIN #tmpznodestate t ON t.statecode= zc.statecode and t.rownum > 1

UPDATE ZOS
SET ShipToStateCode = new_stcode
FROM   ZnodeOmsOrderShipment  ZOS
INNER JOIN #tmpznodestate t ON t.statecode= ZOS.ShipToStateCode and t.rownum > 1
  
UPDATE ZS
SET ZS.StateCode =  new_stcode
FROM ZnodeShipping ZS
INNER JOIN #tmpznodestate t ON t.statecode= ZS.StateCode and t.rownum > 1
  
UPDATE ZA
SET Statename = new_stcode
FROM ZnodeAddress ZA
INNER JOIN #tmpznodestate t ON t.statecode= ZA.Statename and t.rownum > 1

DELETE FROM Znodestate
WHERE EXISTS ( SELECT TOP 1 1 FROM #tmpznodestate asd 
	WHERE rownum >1 and asd.StateId = Znodestate.StateId)

UPDATE ZnodeState
SET StateName = REPLACE( LEFT(StateName, CHARINDEX('kraj', StateName) - 1),'²','')
WHERE countrycode='SK' AND StateName like '%²%'

