DISABLE TRIGGER Trg_ZNodeCountry_GlobalSetting ON ZnodeCountry;  
--Adding new column for reference
IF NOT EXISTS(SELECT * FROM INFORMATION_SCHEMA.columns WHERE TABLE_NAME = 'ZnodeCountry' and COLUMN_NAME = 'OldCountryCode')
BEGIN
	ALTER TABLE ZnodeCountry ADD OldCountryCode VARCHAR(300)

END
GO
UPDATE ZnodeCountry SET OldCountryCode = CountryCode WHERE 1=1
GO
IF OBJECT_ID('tempdb..#CountryDetails') IS NOT NULL
	DROP TABLE #CountryDetails

SELECT Country AS CountryName,Alpha_2 AS CountryCode
INTO #CountryDetails
FROM CountryStateDetailsNew
WHERE country IS NOT NULL 
AND Alpha_2 IS NOT NULL  

--updating existing country code in country table 
UPDATE B SET B.CountryName = A.CountryName,ModifiedDate=GETDATE()
FROM #CountryDetails A
INNER JOIN znodecountry B on B.CountryCode =A.CountryCode
WHERE LTRIM(RTRIM(A.CountryName))<>LTRIM(RTRIM(B.CountryName))

GO
--Inserting new countries as per the given sheet
INSERT INTO ZnodeCountry(CountryCode,CountryName,DisplayOrder,IsActive,IsDefault,CreatedBy,CreatedDate,ModifiedBy,ModifiedDate)
SELECT DISTINCT CountryCode,CountryName,999,1,0,2,GETDATE(),2,GETDATE() FROM #CountryDetails A
WHERE --CountryName NOT IN (SELECT CountryName FROM ZnodeCountry) AND 
NOT EXISTS(SELECT * FROM ZnodeCountry B WHERE A.CountryCode=B.CountryCode)
GO

Update ZnodeCountry set CountryName='British Indian Ocean Territory'
where CountryName='British Indian Ocean Trty'

Update ZnodeCountry set CountryName='French Southern Territories'
where CountryName='French Southern Trty'

Update ZnodeCountry set CountryName='Heard Island and McDonald Islands'
where CountryName='Heard Island And Mcdonald'

Update ZnodeCountry set CountryName='Saint Martin (French part)'
where CountryName='Saint-martin (france)'

Update ZnodeCountry set CountryName='South Georgia and the South Sandwich Islands'
where CountryName='South Georgia'

Update ZnodeCountry set CountryName='Virgin Islands (U.S.)'
where CountryName='Virgin Islands, U.s.'

Update ZnodeCountry set CountryCode='BY' 
Where CountryName='Belarus'

Delete from ZnodeCountry where CountryName in ('Yugoslavia','Netherlands Antilles');

ENABLE TRIGGER Trg_ZNodeCountry_GlobalSetting ON ZnodeCountry;  
