IF OBJECT_ID('tempdb..#StateDetailsnew') IS NOT NULL
	DROP TABLE #StateDetailsnew
--Preparing data for state
SELECT DISTINCT Alpha_2 AS CountryCode,Sub_division_Code AS StateCode,Sub_Division AS StateName
INTO #StateDetailsnew
FROM StateDetailsnew
WHERE Sub_Division <> '-' AND Sub_Division <> '--' AND Sub_Division IS NOT NULL 
AND Sub_division_Code <> '-' AND Sub_division_Code <> '--' AND Sub_division_Code IS NOT NULL 
AND EXISTS(SELECT * FROM ZnodeCountry WHERE StateDetailsnew.Alpha_2 = ZnodeCountry.CountryCode)

ALTER TABLE #StateDetailsnew ADD StateCode1 VARCHAR(1000)
UPDATE #StateDetailsnew set StateCode1 = ltrim(rtrim(SUBSTRING(StateCode,CHARINDEX('-',StateCode)+1,(LEN(StateCode)))))

;
WITH CTE1 AS (
    
	SELECT 
        *,
        DENSE_RANK() over(partition by CountryCode,StateCode1 ORDER BY CountryCode,StateCode1,Statename)row_num from #StateDetailsnew
)
DELETE  FROM CTE1
WHERE row_num > 1;  

--New State code need to update on old one in znodeStatename

UPDATE B SET B.StateName = A.StateName ,ModifiedDate=GETDATE()
FROM #StateDetailsnew A
INNER JOIN ZnodeState B ON B.StateCode =a.StateCode1  and A.CountryCode = B.CountryCode
WHERE B.StateName <> A.StateName --SUBSTRING(A.StateCode,CHARINDEX('-',A.StateCode)+1,(LEN(A.StateCode)))<>LTRIM(RTRIM(B.StateCode))

--Inserting new states data in state table
INSERT INTO ZnodeState(CountryCode,StateCode,StateName,IsActive,IsDefault,CreatedBy,CreatedDate,ModifiedBy,ModifiedDate)
SELECT DISTINCT CountryCode,SUBSTRING(StateCode,CHARINDEX('-',StateCode)+1,(LEN(StateCode))),StateName,1,0,2,GETDATE(),2,GETDATE() FROM #StateDetailsnew A
WHERE statename<>'-' AND statename<>'--' AND statename IS NOT NULL
AND StateCode<>'-' AND StateCode<>'--' AND StateCode IS NOT NULL
AND NOT EXISTS(SELECT * FROM ZnodeState B WHERE A.StateCode1=B.StateCode and A.CountryCode = B.CountryCode)

;WITH cte AS (
    SELECT 
        *,
        ROW_NUMBER() OVER (
            PARTITION BY 
               Statename,countrycode,statecode
            ORDER BY 
                Statename
        ) row_num
     FROM 
        Znodestate
)
DELETE FROM cte
WHERE row_num > 1;    
GO
 Delete FROM ZnodeState WHERE NOT EXISTS 
(SELECT * FROM #StateDetailsnew X WHERE ZnodeState.CountryCode = X.CountryCode and ZnodeState.StateCode = X.StateCode1)
and Exists (SELECT * FROM #StateDetailsnew X WHERE ZnodeState.CountryCode = X.CountryCode and ZnodeState.StateName = X.StateName)
