INSERT INTO ZnodeManageConditionalDefaultData (ConditionalCode,ConditionalName,DataSource,IsActive,CreatedBy,CreatedDate,ModifiedBy,ModifiedDate)
SELECT 'DeleteOldCountryOneTime',
	'This is only for delete old Country during fresh / upgrade of existing database & this will execute only one time.'
		,'Upgrade Database',1,2, GETDATE(),2 , GETDATE()
WHERE NOT EXISTS (SELECT TOP 1 1 FROM ZnodeManageConditionalDefaultData WHERE ConditionalCode = 'DeleteOldCountryOneTime' AND IsActive=1);
