--Insert above data in country table.
INSERT INTO ZnodeCountry(CountryCode,CountryName,DisplayOrder,IsActive,IsDefault,CreatedBy,CreatedDate,ModifiedBy,ModifiedDate)
SELECT DISTINCT CountryCode,CountryName,999,1,0,2,GETDATE(),2,GETDATE() FROM #Country A
WHERE NOT EXISTS(SELECT * FROM ZnodeCountry B WHERE A.CountryCode = B.CountryCode)
GO
--Update isdefault flag 'True' for US
UPDATE ZnodeCountry SET IsDefault=1 WHERE CountryCode='US'
GO
--Remove duplicate data from table
DELETE FROM ZnodeCountry
WHERE ZnodeCountry.CountryId NOT IN
(
SELECT MIN(x.CountryId)
FROM ZnodeCountry X where X.CountryCode = ZnodeCountry.CountryCode 
GROUP BY x.CountryCode                  
) 

GO

DELETE A
FROM 
(
	SELECT *,ROW_NUMBER() OVER (PARTITION BY CountryCode ORDER BY CreatedDate) As Rn FROM ZnodeCountry
) a 
WHERE a.Rn>1;

GO

UPDATE ZnodeCountry
SET CountryName = 'United States'
WHERE CountryCode='US';
